import React, { Component } from 'react';
import './navbar.css';
import { Button, Typography } from '@material-ui/core';

class Navbar extends Component {
  navigateTo(page) {
    window.location.href = page;
  }

  render() {
    return (
      <div id="navbar-container">
        <Typography id="navbar-title-container" variant='h3'>
          NATALIE WAGNER
        </Typography>
        <div id="navbar-buttons-container">
          <Button onClick={() => this.navigateTo('index.html').bind(this)}>
            Home
          </Button>
          <Button onClick={() => this.navigateTo('about.html').bind(this)}>
            About
          </Button>
          <Button onClick={() => this.navigateTo('projects.html').bind(this)}>
            Projects
          </Button>
          <Button onClick={() => this.navigateTo('quiz.html').bind(this)}>
            Quiz
          </Button>
          <Button onClick={() => this.navigateTo('links.html').bind(this)}>
            My Links
          </Button>
        </div>
      </div>
    );
  }
}

export default Navbar;
